import React from 'react';
import logo from './logo.svg';
import './App.css';


const Welcome = () => { 
  return (
    <h1>Hello, IT-KAMASUTRA</h1>
  );
}
const App = () => {
  return (
    <div className="App">
      <div><Welcome/></div>
      <ul>
        <li>css</li>
        <li>html</li>
        <li>js</li>
        <li>react</li>
      </ul>
      <div><Header/></div>
    </div>
  );
}
const Header = () =>{
  return(
    <div><h2>Hello Adilet</h2></div>
  );
}


export default App;
